// Imp React Imports
import React, { Component } from 'react';
import {
  BrowserRouter as Router,
  Route,
  Switch,
  Link,
  Redirect
} from 'react-router-dom';

// CSS imports
import './App.css';
import "bootstrap/dist/css/bootstrap.min.css";

// Pages Imports
import Home from "./page";
import page404 from '../src/page/404/404';
import Pool1 from "../src/page/pool1/pool1";
import LDRPOOL from "../src/pages/ldr_pool/ldr"

// Actual Page render
class App extends Component {
  render() {
    return (
      <Router>
        <Switch>
          <Route excat path="/home" component={Home} />
          <Route excat path="/pool1" component={Pool1} />
          <Route excat path="/ldr" component={Home} />
          {/* <Route excat path="/" component={Home} /> */}
          {/* <Route excat path="/" component={Home} /> */}
          <Route excat path="/404" component={page404}></Route>
          <Redirect to="/404" />
        </Switch>
      </Router>
    );
  }
}
export default App;
